import { useTranslation } from "react-i18next";
import styled from "styled-components";

import { ISelect } from "@interfaces";

interface IProps {
    days: ISelect[];
    months: ISelect[];
    years: ISelect[];
}

export const ComponentDate = (props: IProps) => {
    //page hook
    const { t } = useTranslation();
    return (
        <StyledContainer>
            <div className="title">{t("page.sign_up.birth_date")}</div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div``;
